import React from "react";
import MyLayout from "../../MyLayout";

function HomeLayout(){

    return (
        <div className="hommWrapper">
           <section></section>
        </div>
    )
}
export default function Home(){

    return (
        <>
            <MyLayout
                container={<HomeLayout/>}
            />
        </>
    )
}
